using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;
using PPS.Models;
using Microsoft.EntityFrameworkCore;

namespace PPS.Data
{
  public class DbInitializer
  {

    public static void Initialize(ConectorDB context)
    {
      context.Database.EnsureDeleted();
      context.Database.EnsureCreated();

      //PROVINCIAS
      var provincias = new String[] { "Nacional" , "Jujuy", "Salta" , "Formosa" , "Tucumán" , "Chaco" ,
                                      "Catamarca" , "Santiago Del Estero" , "Corrientes" , "Misiones",
                                      "La Rioja" , "Cordoba" , "Santa Fe", "Entre Rios" , "San Juan",
                                      "San Luis", "Mendoza" , "La Pampa", "Buenos Aires" , "Neuquen",
                                      "Rio Negro", "Chubut" , "Santa Cruz", "Tierra Del Fuego"};

      foreach (String p in provincias)
      {
        context.Provincias.Add(new Provincia(p));
      }
      context.SaveChanges();


      //LOCALIDADES:

      //Bs As
      context.Localidades.Add(new Localidad("Jose C. Paz", context.Provincias.Find("Buenos Aires")));
      context.Localidades.Add(new Localidad("San Miguel", context.Provincias.Find("Buenos Aires")));

      //Cordoba
      context.Localidades.Add(new Localidad("Rio Cuarto", context.Provincias.Find("Cordoba")));

      //Mendoza
      context.Localidades.Add(new Localidad("San Rafael", context.Provincias.Find("Mendoza")));

      //Jujuy
      context.Localidades.Add(new Localidad("San Salvador de Jujuy", context.Provincias.Find("Jujuy")));

      //Salta
      context.Localidades.Add(new Localidad("Salta", context.Provincias.Find("Salta")));

      //Formosa
      context.Localidades.Add(new Localidad("Formosa", context.Provincias.Find("Formosa")));

      //Tucuman
      context.Localidades.Add(new Localidad("San Miguel de Tucuman", context.Provincias.Find("Tucumán")));

      //Chaco
      context.Localidades.Add(new Localidad("Resistencia", context.Provincias.Find("Chaco")));

      //Catamarca
      context.Localidades.Add(new Localidad("San Fernando Del Valle De Catamarca", context.Provincias.Find("Catamarca")));

      //Santiago del Estero
      context.Localidades.Add(new Localidad("Santiago del Estero", context.Provincias.Find("Santiago Del Estero")));

      //Corrientes
      context.Localidades.Add(new Localidad("Corrientes", context.Provincias.Find("Corrientes")));

      //Misiones
      context.Localidades.Add(new Localidad("Posadas", context.Provincias.Find("Misiones")));

      //La Rioja
      context.Localidades.Add(new Localidad("La Rioja", context.Provincias.Find("La Rioja")));

      //Santa Fe
      context.Localidades.Add(new Localidad("Santa Fe", context.Provincias.Find("Santa Fe")));

      //Entre Rios
      context.Localidades.Add(new Localidad("Parana", context.Provincias.Find("Entre Rios")));

      //San Juan
      context.Localidades.Add(new Localidad("San Juan", context.Provincias.Find("San Juan")));

      //San Luis
      context.Localidades.Add(new Localidad("San Luis", context.Provincias.Find("San Luis")));

      //La Pampa
      context.Localidades.Add(new Localidad("Santa Rosa", context.Provincias.Find("La Pampa")));

      //Neuquen
      context.Localidades.Add(new Localidad("Neuquen", context.Provincias.Find("Neuquen")));

      //Rio Negro
      context.Localidades.Add(new Localidad("Viedma", context.Provincias.Find("Rio Negro")));

      //Chubut
      context.Localidades.Add(new Localidad("Rawson", context.Provincias.Find("Chubut")));

      //Santa Cruz
      context.Localidades.Add(new Localidad("Rio Gallegos", context.Provincias.Find("Santa Cruz")));

      //Tierra del Fuego
      context.Localidades.Add(new Localidad("Usuhaia", context.Provincias.Find("Tierra del Fuego")));

      // Para candidato provincias
      foreach (String p in provincias)
      {
        context.Localidades.Add(new Localidad("", context.Provincias.Find(p)));
      }

      // Para pais
      context.Localidades.Add(new Localidad("", context.Provincias.Find("Nacional")));
      context.SaveChanges();


      //PARTIDOS
      List<PartidoPolitico> partidos = new List<PartidoPolitico>();
      PartidoPolitico pro = new PartidoPolitico("Pro", context.Provincias.Find("Nacional"), "#ffff00");
      PartidoPolitico uc = new PartidoPolitico("Unidad Ciudadana", context.Provincias.Find("Nacional"), "#0000ff");
      PartidoPolitico unP = new PartidoPolitico("1 Pais", context.Provincias.Find("Nacional"), "#ff00ff");
      PartidoPolitico ucr = new PartidoPolitico("Union Civica Radical", context.Provincias.Find("Nacional"), "#ff0000");

      context.Partidos.Add(pro);
      context.Partidos.Add(uc);
      context.Partidos.Add(unP);
      context.Partidos.Add(ucr);
      context.SaveChanges();


      //CANDIDATOS
      //Concejales
      Candidato concejalPro = new Candidato("Gaston", "Sturla", context.Localidades.Find(3), Cargo.Concejal, "", pro);
      //Senadores Nacionales
      Candidato senadorPro = new Candidato("Fernando", "Caveri", context.Localidades.Find(1), Cargo.SenadorNacional, "", pro);
      Candidato senador1p = new Candidato("Sergio", "Massa", context.Localidades.Find(3), Cargo.SenadorNacional, "", unP);
      Candidato senadorUc = new Candidato("Cristina", "Fernandez", context.Localidades.Find(3), Cargo.SenadorNacional, "", uc);
      Candidato senadorUcr = new Candidato("Gustavo", "Lopez", context.Localidades.Find(3), Cargo.SenadorNacional, "", ucr);

      context.Candidatos.Add(concejalPro);
      context.Candidatos.Add(senadorPro);
      context.Candidatos.Add(senadorUc);
      context.Candidatos.Add(senador1p);
      context.Candidatos.Add(senadorUcr);
      context.SaveChanges();


      //MESAS y RECUENTOS
      List<Localidad> localidades = context.Localidades.Where(x => x.nombreLocalidad != "").Include(x => x.provincia).ToList();
      foreach (Localidad loc in localidades)
      {
        for (int i = 0; i < 50; i++)
        {
          Mesa mesa = new Mesa(i, loc);
          context.Mesas.Add(mesa);
          Random rnd = new Random();
          Recuento r1 = new Recuento(senadorPro, rnd.Next(1,51), mesa);
          Recuento r2 = new Recuento(senador1p, rnd.Next(1, 51), mesa);
          Recuento r3 = new Recuento(senadorUc, rnd.Next(1, 51), mesa);
          Recuento r4 = new Recuento(senadorUcr, rnd.Next(1, 51), mesa);
          context.Recuentos.Add(r1);
          context.Recuentos.Add(r2);
          context.Recuentos.Add(r3);
          context.Recuentos.Add(r4);
        }
      };
      context.SaveChanges();

      //USUARIOS
      if (!context.Usuarios.Any())
      {
        Usuario u = new Usuario("user", "user", "Usuario", 0);
        Usuario g = new Usuario("gaston", "sturla", "User", 0);
        context.Usuarios.Add(new Usuario("sadmin", "sadmin", "Super Administrador", 2));
        context.Usuarios.Add(new Usuario("admin", "admin", "Administrador", 1));
        context.Usuarios.Add(u);
        context.Usuarios.Add(g);
        context.Fiscales.Add(new Fiscalizacion(u, context.Mesas.Find(1)));
        context.Fiscales.Add(new Fiscalizacion(g, context.Localidades.Find(1)));
        context.SaveChanges();
      }

      //TELEGRAMA
      context.Telegramas.Add(new Telegrama("data:image/jpeg;base64,", context.Mesas.Where(x => x.numero == 1 && x.localidad.id == 1).FirstOrDefault()));
      context.SaveChanges();

    }
  }
}
